import PropTypes from 'prop-types';
import { withTranslation } from "react-i18next"
import { Link } from "react-router-dom"

import {
  Table,
  Card,
  CardBody,
  Row,
  Col,
  Button
} from "reactstrap"


const SearchResults = (props) => {

   // if (!props.items) {
    //return null;
  //}

  const dataRows = props.results.map((data) => (
    <tr key={data.id}>
              <th scope="row">{ data.date }</th>
              <td>{ data.procedure }</td>
            <td>{ data.client.number }</td> 
      <td>{ data.client.name }</td>
      <td>{ data.facilityType }</td>
      <td>{ data.proposalType }</td>
      <td style={{textAlign:"right"}}> 
        <Button  color="link" className="btn btn-link" title={props.t("Signed")}> <i className="mdi mdi-file-document-edit-outline mdi-24px"></i>   </Button> | <Button  color="link" className="btn btn-link" title={props.t("Cancelled")}> <i className="mdi mdi-file-remove-outline mdi-24px"></i>  </Button>
      </td>
    </tr>)
  );

  return (
    <Row>
      <Col lg="12">
        <h4 className="card-title">{ props.t("Results") }</h4>
        <p className="card-title-desc"></p>
        <Row>
          <Col lg="12">
            <div className="table-responsive">
              <Table className="table mb-0">
                <thead className="table-light">
                  <tr>
                  <th>{props.t("Date")}</th>
                <th>{props.t("No.tramite")}</th>
                <th>{props.t("Client Number")}</th>
                <th>{props.t("Client Name")}</th>
                <th>{props.t("FacilityType")}</th>
                <th>{props.t("ProposalType")}</th>
               
                    <th></th>

                  </tr>
                </thead>
                <tbody>
                  {dataRows}
                </tbody>
              </Table>
            </div>
          </Col>
        </Row>
      </Col>
    </Row>
  );
};

SearchResults.propTypes = {
  //items: PropTypes.array.isRequired,
}

export default (withTranslation()(SearchResults));
